LAHORE, June 10 (APP): Former members of provincial assembly (MPAs), Mian Marghoob Ahmad and Mian Mujtaba Shuja ur Rehman on Saturday called on Prime Minister Muhammad Shehbaz Sharif.
During the meeting, they discussed the current political situation, PM Office Media Wing said in a press release.
